import React from 'react';
import './feature.css';

const Feature = ({title, text}) => {
  return(
    <div className="stars__features-container__feature">
      <div className="stars__features-container__feature-title">
        <div />
        <h1>{title}</h1>
      </div>
      <div className="stars__features-container_feature-text">
        <p>{text}</p>
      </div>
    </div>
  )
}

export default Feature
